import Header from "../../Components/Header/Header";
import SideBar from "../../Components/SideBar/SideBar";
import Posts from "../../Components/Posts/Posts";
import "./Home.css";
const Home = () => {
  return (
    <div className="home">
      <Header />
      <SideBar />
      <Posts />
    </div>
  );
};
export default Home;
